script:
const size = 32;

reset();

let s = size + 4;
box(
  s * -0.5, 0, s * -0.5,
  s, s, s,
  2
);
s = size + 2;
box(
  s * -0.5, 1, s * -0.5,
  s, s, s,
  1
);
sphere(
  -1, size * 0.5 + 1, -1,
  size * 0.5,
  (x, y, z) => noise.noise3d(x / 8, y / 6, z / 8) > 0.6 ? (Math.random() > 0.01 ? 1 : 3) : 0
);

const elevator = {
  x: -4,
  y: size - 10,
  z: 13,
};
box(
  elevator.x - 1, elevator.y - 1, elevator.z + 5,
  10, 11, 4,
  2
);
box(
  elevator.x, elevator.y, elevator.z,
  8, 9, 8,
  1
);
box(
  elevator.x + 1, elevator.y + 1, elevator.z + 1,
  6, 7, 6,
  2
);
box(
  elevator.x + 2, elevator.y + 2, elevator.z + 2,
  4, 5, 4,
  0
);
box(
  elevator.x + 3, elevator.y + 2, elevator.z,
  2, 4, 2,
  0
);
